INSERT INTO `juegos` VALUES (1,'Legend of Zelda',6,120.00,'Activo','The Legend of Zelda es una famosa franquicia de videojuegos de acciÃƒÂ³n y aventura creada por Nintendo. Los juegos siguen las ÃƒÂ©picas aventuras de Link para rescatar a la Princesa Zelda y derrotar al malvado Ganon. Destaca por su jugabilidad emocionante, mundos inmersivos y personajes memorables.',9,'AVN'),(2,'Resident Evil 4',4,130.00,'Activo','Resident Evil 4 es un exitoso videojuego de acciÃƒÂ³n y supervivencia desarrollado por Capcom. La historia sigue a Leon S. Kennedy en su misiÃƒÂ³n para rescatar a la hija del presidente en un pueblo plagado de criaturas infectadas. Destaca por su innovador sistema de juego, atmÃƒÂ³sfera tensa y combates intensos.',10,'ACC'),(3,'Hogwarts Legacy',8,170.00,'Activo','Hogwarts Legacy es un esperado videojuego de rol de acciÃƒÂ³n ambientado en el universo de Harry Potter. Los jugadores se sumergen en la experiencia de ser un estudiante de Hogwarts, explorando el castillo, aprendiendo hechizos y participando en emocionantes aventuras. Con una narrativa envolvente y grÃƒÂ¡ficos impresionantes, ofrece una nueva y emocionante forma de explorar el mundo mÃƒÂ¡gico de Harry Potter.',11,'AVN'),(4,'Elden Ring',9,200.00,'Activo','Elden Ring es un anticipado videojuego de acciÃƒÂ³n y rol desarrollado por FromSoftware en colaboraciÃƒÂ³n con el escritor George R.R. Martin. Ambientado en un vasto mundo de fantasÃƒÂ­a, ofrece una experiencia desafiante y envolvente. Con su atmÃƒÂ³sfera oscura, combate estratÃƒÂ©gico y exploraciÃƒÂ³n de un mundo abierto, Elden Ring promete cautivar a los jugadores con su intrincada narrativa y diseÃƒÂ±o de juego caracterÃƒÂ­stico de FromSoftware.',12,'AVN'),(5,'The Mortuary Assistant',4,100.00,'Activo','The Mortuary Assistant es un juego de aventuras y misterio en el que los jugadores asumen el papel de un asistente en un sombrÃƒÂ­o y misterioso depÃƒÂ³sito de cadÃƒÂ¡veres. DeberÃƒÂ¡n resolver enigmas y descubrir secretos ocultos mientras dese